import React from 'react'
import { useAppDispatch, useAppSelector } from './store'
import { addCartItem } from './actions/cart'
import { Sku } from './reducers/cart'

const App = () => {
    const sku: Sku = {
        id: "69420",
        name: "Air Jordan 1 Retro High OG Bred Toe",
        image: undefined,
        size: 6,
        price: 69420,
        colorway: "Black/White-Varsity Red",
        skuStringID: "69420",
        gender: "Male",
        brandName: "Nike",
        laces: true,
        condition: true,
        bestSeller: true,
        manufacturer: "Nike",
    }
        const dispatch = useAppDispatch()
        const cart = useAppSelector(state => state.cart.items)
        return (
            <div>
                <button onClick={() => dispatch( addCartItem(sku) )}>CLICK ME U FUCKER</button>
                <div>
                {cart && (
                    Array.from(cart.entries()).map(([item, quantity]) => (
                        <div key={item.id}>
                            {item.name}, {quantity}
                        </div>
                    ))
                )}
                </div>
            </div>
        )
    }

export default App
